pragma solidity ^0.8.0;

import "../Market.sol";

bytes32 constant MARKETORDER = keccak256("MarketOrder");

contract MarketOrder is Market, MarketPathWriter {
    using Array for uint256[];
    using Array for bytes32[];

    function id() public view virtual override (Market) returns (bytes32) {return MARKETORDER;}

    modifier onlyMarketOrder() virtual {
        checkMarketOrder();
        _;
    }

    function checkMarketOrder() internal view {
        //require((address(rep.mo()) == _msgSender()), "Allowance: caller must be Market");
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      event
    /////////////////////////////////////////////////////////////////////////////////////////
    event Transaction(
        bytes32 indexed fromk_,
        bytes32 indexed tok_,
        address fromaccount_,
        address toaccount_,
        uint256 quote_,
        uint256 qty_
    );

    /////////////////////////////////////////////////////////////////////////////////////////
    //      storage
    /////////////////////////////////////////////////////////////////////////////////////////
    //bool private constant _autodeleteorders = true;

    constructor(Repository rep_) Market(rep_) {}

    /////////////////////////////////////////////////////////////////////////////////////////
    //      PROCESSING     internal processing
    /////////////////////////////////////////////////////////////////////////////////////////
    function _orderDestroy(Order.Info storage order_) internal {
        _orderids.remove(order_.orderid);
        _pastorders[block.number].push(order_.orderid);
        //delete _orders[order_.orderid];
    }

    function _orderTerminate(Order.Info storage order_, Order.State newstate_)
        internal
    {
        require(
            newstate_ > Order.State.Unknown &&
                newstate_ <= Order.State.Completed &&
                order_.state >= Order.State.Active,
            "_orderTerminate state problem"
        );
        (bytes32 from, bytes32 to) = rep.resolveBytes32Bytes32(order_.fromto);
        //if (newstate_<=Order.State.Completed && order_.state>=Order.State.Active)
        order_.state = newstate_;
        if (Order.isReserved(order_.options))
            Bank(rep.get(BANK))._reserveSub(
                to,
                order_.account,
                address(this),
                UInt64ToUInt256(order_.originalqty - order_.qtydone)
            );
        _fromtoorders[order_.fromto].remove(order_.orderid);
        _fromorders[from].remove(order_.orderid);
        _toorders[to].remove(order_.orderid);
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      PUBLIC
    /////////////////////////////////////////////////////////////////////////////////////////

    function _orderMakeTransfer(
        Order.Info storage order_,
        address toaccount_,
        bool toreserve_,
        uint256 qty_
    ) internal {
        address _fromfeeaccount;
        uint256 _fromfee;
        address _tofeeaccount;
        uint256 _tofee;

        if (_fromfeeaccount == address(0)) _fromfee = 0;
        if (_tofeeaccount == address(0)) _tofee = 0;

        uint256 _toqty = (qty_ * UInt64ToUInt256(order_.quote)) / 10**18;
        (bytes32 from, bytes32 to) = rep.resolveBytes32Bytes32(order_.fromto);

        if (Order.isReserved(order_.options))
            Bank(rep.get(BANK))._reserveSub(
                from,
                order_.account,
                address(this),
                qty_
            );
        if (toreserve_)
            Bank(rep.get(BANK))._reserveSub(to, toaccount_, address(this), _toqty);

        if (_fromfee != 0)
            Bank(rep.get(BANK))._transfer(
                from,
                order_.account,
                _fromfeeaccount,
                _fromfee
            );
        if (_tofee != 0)
            Bank(rep.get(BANK))._transfer(to, toaccount_, _tofeeaccount, _tofee);
        Bank(rep.get(BANK))._transfer(
            from,
            order_.account,
            toaccount_,
            qty_ - _fromfee
        );
        Bank(rep.get(BANK))._transfer(
            to,
            toaccount_,
            order_.account,
            _toqty - _tofee
        );
    }

    function orderFulfill(
        uint256 orderid_,
        uint256 qty_,
        uint256 quote_,
        uint256 pctslippage_
    ) public all returns (uint256 qtydone_) {
        return
            orderFulfillEx(_msgSender(), orderid_, qty_, quote_, pctslippage_);
    }

    function orderFulfillEx(
        address account_,
        uint256 orderid_,
        uint256 qty_,
        uint256 quote_,
        uint256 pctslippage_
    ) public all returns (uint256 qtydone_) {
        (bool _result, ) = rep.get(MARKET).call(
            abi.encodeWithSelector(
                bytes4(
                    keccak256(
                        "d_orderFulfillEx(address,uint32,uint256,uint256,uint256)"
                    )
                ),
                address(this),
                account_,
                orderid_,
                qty_,
                quote_,
                pctslippage_
            )
        );
        _return(_result);
    }

    function d_orderFulfillEx(
        address account_,
        uint256 orderid_,
        uint256 qty_,
        uint256 quote_,
        uint256 pctslippage_
    ) public onlyMarketOrder returns (uint256 qtydone_) {
        require(!STOP(), "Contract stopped");
        require(
            rep.MODETEST() || account_ == _msgSender(),
            "Must be account==_msgSender() or Mode Testing"
        );
        Order.Info storage _order = _orders[orderid_];
        (bytes32 from, bytes32 to) = rep.resolveBytes32Bytes32(_order.fromto);

        require(
            (qty_ * quote_) / 10**18 <= Bank(rep.get(BANK)).available(to, account_),
            "Bank: Not enough available"
        );

        uint256 _quote;
        if (Order.isIndexed(_order.options)) {
            // this must update _quote by reentrant call back
            (, _quote, ) = Quotator(rep.get(QUOTATOR)).read(from, to);
        } else _quote = UInt64ToUInt256(_order.quote);
        require(
            _quote <= (quote_ * (10**18 - pctslippage_)) / 10**18 &&
                _quote >= (quote_ * (10**18 + pctslippage_)) / 10**18,
            "Quote Slipped over tolerance"
        );

        uint256 _qty = (qty_ * quote_) / _quote;
        uint256 _orderqty = UInt64ToUInt256(_order.qty - _order.qtydone);
        if (_orderqty < _qty) _qty = _orderqty;

        _orderMakeTransfer(_order, account_, false, qty_);

        _order.qtydone += UInt256ToUInt64(qty_);
        if (_order.qtydone == _order.originalqty)
            _orderTerminate(_order, Order.State.Completed);

        //if (!Order.isHidden(_order.options))
        emit Transaction(from, to, _order.account, account_, _quote, _qty);
        if (_order.state <= Order.State.Completed) _orderDestroy(_order);

        return qty_;
    }


    function orderPlaceEx(
        address from_,
        uint256 fromid_,
        address to_,
        uint256 toid_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public all returns (uint256 orderid_) {
        return
            orderPlace(
                _msgSender(),
                rep.currency(from_, fromid_),
                rep.currency(to_, toid_),
                granularity_,
                qty_,
                quote_,
                options_
            );
    }

    function orderPlace(
        address account_,
        address from_,
        uint256 fromid_,
        address to_,
        uint256 toid_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public all returns (uint256 orderid_) {
        return
            orderPlace(
                account_,
                rep.currency(from_, fromid_),
                rep.currency(to_, toid_),
                granularity_,
                qty_,
                quote_,
                options_
            );
    }

    function orderPlaceEx(
        address account_,
        address from_,
        address to_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public all returns (uint256 orderid_) {
        return
            orderPlace(
                account_,
                rep.currency(from_, 0),
                rep.currency(to_, 0),
                granularity_,
                qty_,
                quote_,
                options_
            );
    }

    function orderPlace(
        bytes32 from_,
        bytes32 to_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public all returns (uint256 orderid_) {
        return
            orderPlace(
                _msgSender(),
                from_,
                to_,
                granularity_,
                qty_,
                quote_,
                options_
            );
    }

    function orderPlace(
        address account_,
        bytes32 from_,
        bytes32 to_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public all returns (uint256 orderid_) {
        (bool _result, ) = rep.get(MARKET).call(
            abi.encodeWithSelector(
                bytes4(
                    keccak256(
                        "d_orderPlace(address,bytes32,bytes32,uint256,uint256,uint256,uint8)"
                    )
                ),
                address(this),
                account_,
                from_,
                to_,
                granularity_,
                qty_,
                quote_,
                options_
            )
        );
        _return(_result);
    }

    function d_orderPlace(
        address account_,
        bytes32 from_,
        bytes32 to_,
        uint256 granularity_,
        uint256 qty_,
        uint256 quote_,
        uint8 options_
    ) public onlyMarketOrder returns (uint256 orderid_) {
        require(!STOP(), "Contract stopped");
        require(
            rep.MODETEST() || account_ == _msgSender(),
            "Must be account==_msgSender or Mode Testing"
        );
        //require(Bank(rep.get(BANK)).features(from_) == 0,"Bank: 'From' type unknown");
        //require(Bank(rep.get(BANK)).features(to_) == 0, "Bank: 'To' type unknown");
        //(address from, ) = rep.resolveCurrency(from_);
        //(address to, ) = rep.resolveCurrency(to_);
        if (rep.hasFeature(from_,Token.SupportTradeable)) {
            address from = rep.resolveCurrencyAddr(from_);
            require(ITradeable(from).tradeable(), "From not tradeable");
            require(
                ITradeable(from).onlyWithCurrency() && to_ != Token.CURRENCY,
                "From is only tradeable to Currency"
            );
        }
        require(
            (!rep.nft(from_)) || qty_ == 10**18 || granularity_ == qty_,
            "'From' is NFT qty and granularity must be 1"
        );

        //bytes32 from = rep.currency(from, fromid_);
        require(
            qty_ <= Bank(rep.get(BANK)).available(from_, account_),
            "Bank: Not enough available"
        );

        Order.Info memory _order;
        /*_order.typefrom = Bank(rep.get(BANK)).tokenType(from_);
        require(
            _order.typefrom != Token.Type.Unknown,
            "Bank: 'From' type unknown"
        );*/
        //if (_order.typefrom == TokenType.Polymorph && nft)
        //    granularity_ = qty_ = IPolymorph(from).getNFTQty();

        _order.account = account_;
        _order.fromto = rep.Bytes32Bytes32(from_, to_);
        //(bytes32 v1,bytes32 v2) = rep.resolveBytes32Bytes32(_order.fromto);
        //require(uint256(v1)==uint256(from_) && uint256(v2)==uint256(to_),"uint256(v1)==uint256(from_) && uint256(v2)==uint256(to_)");

        //_order.typeto = Bank(rep.get(BANK)).tokenType(to_);
        //require(_order.typeto != Token.Type.Unknown, "Bank: 'To' type unknown");
        _order.granularity = UInt256ToUInt64(granularity_);
        _order.qty = UInt256ToUInt64(qty_);
        /*if (_order.typefrom == Token.Type.Polymorph) {
            require(
                (!IPolymorph(from).isTradeableOnlyWithCurrency()) &&
                    (_order.typeto != Token.Type.Cur),
                "Bank: 'From' only tradeable to Currency"
            );
        }
        if (_order.typeto == Token.Type.Polymorph)
            require(
                (!IPolymorph(to).isTradeableOnlyWithCurrency()) &&
                    (_order.typefrom != Token.Type.Cur),
                "Bank: 'To' only tradeable from Currency"
            );
        */
        _order.quote = UInt256ToUInt64(quote_);

        if (Order.isIndexed(_order.options)) {
            uint256 _qquote;
            (, _qquote, ) = Quotator(rep.get(QUOTATOR)).read(from_,to_);
            _order.originalbasedquote = UInt256ToUInt64(_qquote);
            require(_order.originalbasedquote != 0, "Quote: Not quoted");
        }

        if (Order.isReserved(_order.options))
            Bank(rep.get(BANK))._reserveAdd(to_, _order.account, address(this), qty_);

        // we are saving order just now is order isnt completed
        unchecked {
            _orderidptr++;
            while (_orderidptr == 0 && _orders[_orderidptr].orderid != 0)
                _orderidptr++;
        }
        _order.orderid = _orderidptr;

        _order.originalqty = _order.qty;
        _order.state = Order.State.Active;
        _order.options = options_;
        _order.originalquote = _order.quote;

        _orders[_order.orderid] = _order;
        //if (USEFROMTOORDERS)
        _orderids.insert(_order.orderid);
        _fromtoorders[_order.fromto].insert(_order.orderid);
        _fromorders[from_].insert(_order.orderid);
        _toorders[to_].insert(_order.orderid);
        _insertPath(_order.fromto);
        return _orderidptr;
    }

    function orderCancel(uint256 orderid_) public all {
        (bool _result, ) = rep.get(MARKET).call(
            abi.encodeWithSelector(
                bytes4(keccak256("d_orderCancel(uint256)")),
                address(this),
                orderid_
            )
        );
        _return(_result);
    }

    function d_orderCancel(uint256 order_) public onlyMarketOrder {
        require(!STOP(), "Contract stopped");
        Order.Info storage _order = _orders[order_];
        require(
            rep.MODETEST() || _order.account == _msgSender(),
            "Must be account==_msgSender or Mode Testing"
        );
        _orderTerminate(_order, Order.State.Cancelled);
        _orderDestroy(_order);
    }
}
